import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Home extends Component {
  render() {
    return (
      <div>
        <h2>Facial Recognition App</h2>

        <div style={{
  			overflow: 'hidden',
  			color: 'white',
  			'font-size': '12px',
  			padding: '12px 16px',
  			'background-color': '#333',
  			position: 'fixed',
  			bottom: '0',
  			width: '100%'
        }}
        > Noradila Nordin
        </div>

        <p style={{
            color: 'blue',
          }}>
          {new Date().toString()}
          </p>
      </div>
    );
  }
}
